import React from "react";

const AboutCompany = () => {
  return (
    <section className='about'>
      <div className="contaier">
        <div className='about__text-box'>
          <h2 className='heading-secondary u-margin-bottom'>عن الشركة</h2>
          
        </div>
      </div>
    </section>
  );
};

export default AboutCompany;
